import React, { Component } from "react";
import IconBar from '../modules/IconBar.js';
import "../../utilities.css";
import "./HomePage.css";
class HomePage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
        <div className='homepage-container'>
          <h1 className='u-textCenter name-header'>Adam Janicki</h1>
          <div className='navbar-container u-bordering'>
            <h1>About</h1>
            <h1>Courses</h1>
            <h1>{'Work & Projects'}</h1>
          </div>
          <IconBar/>
        </div>

    );
  }
}

export default HomePage;
